inguagem na rea de Engenharia de Software. Nesta apresentao, vamos sintetizar os resultados desse nosso esforo, analisando os pontos fortes e fracos desses modelos, sempre com foco no desenvolvimento de software. Tambm comentaremos e colocaremos em perspectiva conceitos como vibe coding e, por fim, discutiremos o impacto que Modelos de Linguagem podem ter no mercado de trabalho.\n\nMini bio:\nMarco Tulio Valente  doutor em Cincia da Computao pela UFMG, onde  Professor Associado desde 2009. Antes, foi professor da PUC Minas e analista de sistemas na Telemig. Atua em Engenharia de Software, rea na qual publicou mais de uma centena de artigos, orientou dezenas de dissertaes e teses, e recebeu mais de 25 prmios.  autor do livro Engenharia de Software Moderna, adotado por mais de 500 professores no Brasil e publicado tambm em ingls em 2024.\n\nhttps://homepages.dcc.ufmg.br/~mtov/\n\nhttps://engsoftmoderna.info/","commandRuns":[{"startIndex":935,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CPgBEM2rARgBIhMI0cu_o6zrkAMVJoKVAh3uqwJ3SNW8jcmdwJeCWcoBBAm1_Yk=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnZYSWNBcHc0SmhtMU51VmNRZE83QW5GR2hKUXxBQ3Jtc0trdGpFTWRvU1U1T3NiMHNzZm9tdnJZMXhVak9yVVdIRnhJanNzMXFSX2ttZTMyNWJBUXpwNWZKLTVOSDY0VlRPYkhudVpxcm5xN0xVNEc2TUd2R1NKbVNxWUhwUnd6OHdpTERFeDMxNkx6Q3lzUVltMA\u0026q=https%3A%2F%2Fhomepages.dcc.ufmg.br%2F%7Emtov%2F\u0026v=WQReAdkjXlU","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnZYSWNBcHc0SmhtMU51VmNRZE83QW5GR2hKUXxBQ3Jtc0trdGpFTWRvU1U1T3NiMHNzZm9tdnJZMXhVak9yVVdIRnhJanNzMXFSX2ttZTMyNWJBUXpwNWZKLTVOSDY0VlRPYkhudVpxcm5xN0xVNEc2TUd2R1NKbVNxWUhwUnd6OHdpTERFeDMxNkx6Q3lzUVltMA\u0026q=https%3A%2F%2Fhomepages.dcc.ufmg.br%2F%7Emtov%2F\u0026v=WQReAdkjXlU","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":973,"length":2
